import React from 'react';
const product_data = require('./products.json');
class App extends React.Component
{
  parseData(manufacturers,specs)
  {
    document.write(manufacturers);
    switch(specs)
    {
      case "Model":
          return (<li>{specs} : {product_data.Brand[manufacturers].Model}</li>);
      case "Year":
          return (<li>{specs} : {product_data.Brand[manufacturers].Year}</li>);
      case "Specifications":
          return (<li>{specs} : {product_data.Brand[manufacturers].Specifications.Storage}</li>);
    }
  }
  render() {
    return (
      <div className="App">
        <header id="hroot">Header</header>
        <div id="croot">
          <div class="topnav">
            <a class="active" href="#home">Home</a>
            <a href="#news">News</a>
            <a href="#contact">Contact</a>
            <a href="#about">About</a>
          </div>
          <div id="content">
            {Object.keys(product_data.Brand).map(manufacturers => (
              <div id={manufacturers}>
                <strong>{manufacturers}:</strong>
                {Object.keys(product_data.Brand[manufacturers]).map(specs => (
                  <div id={specs}>{this.parseData(product_data,manufacturers, specs)}</div>
                ))}
              </div>
            ))}
          </div>
        </div>
        <footer id="froot">Footer</footer>
      </div>
    );
  }
}
export default App;
